Veuillez réessayer après les étapes suivantes :
1. Vérifiez que la caméra est sous tension ;
2. Assurez-vous que le Bluetooth est activé sur votre téléphone ;
3. Assurez-vous que le téléphone est proche de la caméra ;
4. Réinitialisez la caméra et réessayez.

Veuillez essayer les étapes suivantes avant de réessayer :
1. Vérifiez si le mot de passe Wi-Fi est correct;
2. Maintenez le bouton de réinitialisation enfoncé pour réinitialiser l'appareil;
3. Vérifiez si le routeur a activé des restrictions d'accès ;
4. Essayez de redémarrer le routeur.

